import React from "react";
import { Card, CardImg, CardText, CardBody, CardTitle } from "reactstrap";

function Home(props) {
	return (
		<div className="container main">
			<div className="row">
				<div className="col">
					<h2>Home</h2>
					<hr />
				</div>
			</div>
			<div className="row row-content">
				<div className="col">Hi friends! Welcome to the Rainbow Drop website. We are a top 10 alliance on Phantasy Star Online 2 Global Servers Ship 2 (UR)! Most of the information found on this website can be accessed through our discord, but we wanted to provide another source of information distribution for our current (and future!) members.</div>
			</div>
      <div className="row">
				<div className="col">
					<h2>News</h2>
					<hr />
				</div>
			</div>
		</div>
	);
}

export default Home;
